import { loadWorkers } from '../redux/actions';


const Workers= ()=>{
    const dispatch = useDispatch();

 useEffect(() => {
 dispatch(loadWorkers());
 },[]);

 return (
    <Navbar bg="primary" variants="dark" className='justify-content-center'>
    <Navbar.Brand>
     Workers
    </Navbar.Brand>
    </Navbar>
 );
};

export default Workers
